import React from 'react';
import "./TopMenu.scss";
import { Icon, Menu} from "semantic-ui-react";

export function TopMenu() {
  return (
    <Menu fixed='top' className='top-menu-admin'>
        <Menu.Item className='top-menu-admin__logo'></Menu.Item>
    </Menu>
  )
}
